var Ac4yFlowConstant=require("../constant/Ac4yFlowConstant.js");
var Ac4yLCDStep=require("@ac4y/ac4y-lifecycle/domain/Ac4yLCDStep.js");
var Ac4yLCFStep=require("@ac4y/ac4y-lifecycle/domain/Ac4yLCFStep.js");

class Ac4yFLCDStep extends Ac4yLCDStep {
    
    createSelf(object) {return new Ac4yFLCDStep(object);}
    
    realizesTimeout(){this.becomes(new Ac4yLCFStep({name: new Ac4yFlowConstant().STEP.timeout}));};
    
} // Ac4yFLCDStep

module.exports=Ac4yFLCDStep
